#loading { background: rgb(243, 129, 94); position: fixed; left: 0px; top: 0px; width: 100%; height: 100%; display: flex; align-items: center; justify-content: center; z-index: 999; }.loadingImage { position: relative; width: 30px; height: 30px; background: rgb(46, 152, 223); border-radius: 50px; animation: 1.5s linear 0s infinite normal none running loadingImage; }.loadingImage::after { position: absolute; width: 50px; height: 50px; border-width: 10px; border-style: solid; border-color: rgb(177, 96, 209) transparent; border-radius: 50px; content: ""; top: -20px; left: -20px; animation: 1.5s linear 0s infinite normal none running loadingImage_after; box-sizing: content-box; }@keyframes loadingImage { 
  0% { transform: rotate(0deg); }
  50% { transform: rotate(180deg); background: rgb(46, 204, 113); }
  100% { transform: rotate(360deg); }
}@keyframes loadingImage_after { 
  0% { border-top: 10px solid rgb(177, 96, 209); border-bottom: 10px solid rgb(177, 96, 209); }
  50% { border-top: 10px solid rgb(46, 152, 223); border-bottom: 10px solid rgb(46, 152, 223); }
  100% { border-top: 10px solid rgb(177, 96, 209); border-bottom: 10px solid rgb(177, 96, 209); }
}

